import React from 'react';
import { useSpring, animated } from 'react-spring'

const Groupe5 = () => {
    const props = useSpring({ to: { opacity: 1 }, 
                            from: { opacity: 0 },  
                            config: { duration: 1000 } })

  const anim=    <animated.div style={props}>
        I will fade in
        </animated.div>
    return (
     <button onClick={anim}>click</button>
    )
  }

export default Groupe5;
